import {
  LineChart,
  XAxis,
  YAxis,
  CartesianGrid,
  Line,
  Tooltip,
  Legend,
} from "recharts";

const VariablesGraph = (props) => {
  const data = props.variables.hourly.time.map((x, index) => {
    const dataObject = { x };

    // Iterirajte kroz sve dodatne varijable i dodajte ih u dataObject
    for (const variableName in props.variables.hourly) {
      if (variableName !== "time") {
        dataObject[variableName] = props.variables.hourly[variableName][index];
      }
    }

    return dataObject;
  });

  // Generišite Line komponente za svaku dodatnu varijablu
  const lines = Object.keys(props.variables.hourly)
    .filter((variableName) => variableName !== "time")
    .map((variableName) => (
      <Line
        key={variableName}
        type="monotone"
        dataKey={variableName}
        stroke="#8884d8"
      />
    ));

  return (
    <div
      style={{ display: "flex", justifyContent: "center", marginTop: "10px" }}
    >
      <LineChart width={1000} height={500} data={data}>
        <XAxis dataKey="x" />
        <YAxis dataKey="y" />
        <CartesianGrid stroke="#ccc" />
        {lines}
        <Tooltip />
        <Legend />
      </LineChart>
    </div>
  );
};

export default VariablesGraph;
